import React from "react";

import { Routes, Route } from "react-router-dom";
import { createTheme, ThemeProvider } from "@mui/material";
import pages from "../Pages/index";

export const routes = [
  {
    key: "intro",
    path: "/",
    page: pages.intro(),
  },
  {
    key: "contact",
    path: "/contact",
    page: pages.Contact(),
  },
  {
    key: "financial",
    path: "/financial_information",
    page: pages.Financial(),
  },
  {
    key: "business",
    path: "/business_information",
    page: pages.Business(),
  },
  {
    key: "policy",
    path: "/policies",
    page: pages.Policies(),
  },
  {
    key: "default",
    path: "*",
    page: pages.Intro(),
  },
];

function App() {
  return (
    <ThemeProvider theme={theme}>
      <div className="App">
        <Routes>
          {routes.map((route) => (
            <Route
              key={route.key}
              path={route.path}
              element={route.page}
            ></Route>
          ))}
        </Routes>
      </div>
    </ThemeProvider>
  );
}
const theme = createTheme({});

export default App;
